import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-1f2ef53df3ca6",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/Terry/Sites/VuePressBlog/blog/README.md").then(comp => {
        Vue.component("v-1f2ef53df3ca6", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-200d356edd42d",
    path: "/blog/pix/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/Terry/Sites/VuePressBlog/blog/blog/pix/index.md").then(comp => {
        Vue.component("v-200d356edd42d", comp.default)
        next()
      })
    }
  },
  {
    path: "/blog/pix/index.html",
    redirect: "/blog/pix/"
  },
  {
    name: "v-024e32015a1ab",
    path: "/blog/pix/%E6%97%B6%E5%85%89%E7%BC%A9%E7%95%A5%E6%88%90%E7%85%A7%E7%89%87.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/Terry/Sites/VuePressBlog/blog/blog/pix/时光缩略成照片.md").then(comp => {
        Vue.component("v-024e32015a1ab", comp.default)
        next()
      })
    }
  },
  {
    path: "/blog/pix/时光缩略成照片.html",
    redirect: "/blog/pix/%E6%97%B6%E5%85%89%E7%BC%A9%E7%95%A5%E6%88%90%E7%85%A7%E7%89%87.html"
  },
  {
    name: "v-64d1bf0ca8897",
    path: "/blog/wind/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/Terry/Sites/VuePressBlog/blog/blog/wind/index.md").then(comp => {
        Vue.component("v-64d1bf0ca8897", comp.default)
        next()
      })
    }
  },
  {
