    path: "/resume/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/Terry/Sites/VuePressBlog/blog/resume/index.md").then(comp => {
        Vue.component("v-18b3cd94373a", comp.default)
        next()
      })
    }
  },
  {
